INSERT INTO goods_catalog VALUES
(1, 'Nike M NP TOP SL TIGHT', 7, 'Ткань Nike Pro с влагоотводящей технологией обеспечивает надежную фиксацию и охлаждение. Конструкция без рукавов и облегающий крой демонстрируют твою физическую форму. Плотная посадка для надежной фиксации. Основа: 91% полиэстер/9% спандекс. Вставки: 92% ', x'', 2519.00),
(2, 'Mikasa VT500W утяжеленный', 2, 'Утяжеленный мяч MIKASA VT500W для тренировок выполнен в дизайне по аналогии офиц. мяча V200W. Стандартный размер 5, вес 500 г. Синтетическая кожа (полиуретан+микрофибра), бутиловая камера, армированная нейлоновой нитью, клееный, 18 панелей.', x'', 5990.00),
(3, 'Nike LAL U NK CREW NBA CTS', 3, 'Premium stretch-knit fabric feels soft and fits snugly throughout. Padding in the heel and toe provides cushioning in high-wear areas.', x'', 1999.00),
(4, 'Jordan JUMPMAN SS CREW', 4, 'Мужская футболка Jordan Jumpman из мягкого хлопка обеспечивает комфорт на весь день на площадке и на улице. Хлопковая ткань джерси комфортная и приятная на ощупь. Увеличенный логотип Jumpman нанесен в технике трафаретной печати на груди.', x'', 3999.00),
(5, 'Nike ELITE FRANCHISE SHORT', 5, 'Очень удобны и комфортны в игре, благодаря надёжному лёгкому материалу и влагоотводящим свойствам ткани Dri-FIT.\r\nЭластичный пояс с внутренним шнурком для комфортной посадки по фигуре.\r\nШорты обеспечивают полную свободу движений.', x'', 3499.00),
(6, 'Jordan BREAK SLIDE', 6, 'Шлепанцы Jordan Break с зафиксированным ремешком в верхней части стопы выполнены из прочной синтетической кожи и легкого амортизирующего пеноматериала для абсолютного комфорта.', x'', 4199.00),
(7, 'UA Curry 8', 1, 'Вы никогда раньше не ощущали ничего подобного. Технология UA Flow полностью исключила резину, что сделало Curry 8 легче и невероятно цепкими. Это дает вам лучшее ощущение корта, позволяет вам начинать и останавливаться за долю секунды и быстрее отрываться', x'', 19599.00),
(8, 'Nike GSW M NK THRMFLX SHWTM PANT', 4, 'The Golden State Warriors Therma Flex Showtime Nike NBA Pants offer the lightweight warmth and ease of movement players and fans know and love. Basketball''s authentic warmup has been updated with elastic cuffs and a relaxed fit. They''ve got the look and f', x'', 9799.00),
(9, 'Jordan JUMPMAN QTR 3PPK', 3, 'Твои ноги скажут тебе спасибо. Носки до щиколотки Jordan Everyday Max выполнены из влагоотводящих эластичных материалов. Эта облегающая модель дополнена вшитой подкладкой для поддержки в зонах максимального износа.', x'', 2299.00);

