DELIMITER $$

--
-- Описание для триггера tr_add_goods_in_catalog
--
DROP TRIGGER IF EXISTS tr_add_goods_in_catalog$$
CREATE 
	DEFINER = 'root'@'localhost'
TRIGGER tr_add_goods_in_catalog
	AFTER INSERT
	ON goods_catalog
	FOR EACH ROW
BEGIN
  INSERT INTO storage SET IDgc = NEW.idgc, sCount = 0;
END
$$

--
-- Описание для триггера tr_remove_goods_from_catalog
--
DROP TRIGGER IF EXISTS tr_remove_goods_from_catalog$$
CREATE 
	DEFINER = 'root'@'localhost'
TRIGGER tr_remove_goods_from_catalog
	BEFORE DELETE
	ON goods_catalog
	FOR EACH ROW
BEGIN
  DELETE FROM storage WHERE (IDgc=OLD.IDgc) AND (sCount=0);
END
$$

--
-- Описание для триггера tr_op_goods_list_add
--
DROP TRIGGER IF EXISTS tr_op_goods_list_add$$
CREATE 
	DEFINER = 'root'@'localhost'
TRIGGER tr_op_goods_list_add
	AFTER INSERT
	ON op_goods_list
	FOR EACH ROW
BEGIN
  DECLARE operation_type integer;

  SELECT operations.oIsSale FROM operations
    WHERE operations.IDoperation=NEW.IDoperation INTO operation_type;

  IF operation_type=0 THEN
    UPDATE storage s SET s.sCount=s.sCount+NEW.ocCount
      WHERE s.IDgc=NEW.IDgc;
  ELSE
    UPDATE storage s SET s.sCount=s.sCount=NEW.ocCount
      WHERE s.IDgc=NEW.IDgc;
  END IF;
END
$$

--
-- Описание для триггера tr_op_goods_list_edit
--
DROP TRIGGER IF EXISTS tr_op_goods_list_edit$$
CREATE 
	DEFINER = 'root'@'localhost'
TRIGGER tr_op_goods_list_edit
	AFTER UPDATE
	ON op_goods_list
	FOR EACH ROW
BEGIN
  DECLARE operation_type integer;

  SELECT operations.oIsSale FROM operations WHERE operations.IDoperation=NEW.IDoperation INTO operation_type;
    IF operation_type=0 THEN
  UPDATE storage s SET s.sCount=s.sCount-OLD.ocCount WHERE s.IDgc=OLD.IDgc;
  UPDATE storage s SET s.sCount=s.sCount+NEW.ocCount WHERE s.IDgc=NEW.IDgc;
  ELSE
  UPDATE storage s SET s.sCount=s.sCount+OLD.ocCount WHERE s.IDgc=OLD.IDgc;
  UPDATE storage s SET s.sCount=s.sCount-NEW.ocCount WHERE s.IDgc=NEW.IDgc;
  END IF;
END
$$

--
-- Описание для триггера tr_op_goods_list_remove
--
DROP TRIGGER IF EXISTS tr_op_goods_list_remove$$
CREATE 
	DEFINER = 'root'@'localhost'
TRIGGER tr_op_goods_list_remove
	AFTER DELETE
	ON op_goods_list
	FOR EACH ROW
BEGIN
  DECLARE operation_type integer;

  SELECT operations.oIsSale FROM operations
    WHERE operations.IDoperation=OLD.IDoperation INTO operation_type;

  IF operation_type=0 THEN
    UPDATE storage s SET s.sCount=s.sCount+OLD.ocCount
      WHERE s.IDgc=OLD.IDgc;
  ELSE
    UPDATE storage s SET s.sCount=s.sCount=OLD.ocCount
      WHERE s.IDgc=OLD.IDgc;
  END IF;
END
$$

